import './MovieItem.css';

const MovieItem = (props) => {
    return (
        <div>
            <p>{props.title}</p>
            <p>{props.year}</p>
            <p>{props.author}</p>
            <p>{props.length}</p>
            <p>{props.rating}</p>
            <p>{props.genre}</p>
        </div>
    );
};

export default MovieItem;
